{"metadata":{"kernelspec":{"name":"ir","display_name":"R","language":"R"},"language_info":{"name":"R","codemirror_mode":"r","pygments_lexer":"r","mimetype":"text/x-r-source","file_extension":".r","version":"4.0.5"},"kaggle":{"accelerator":"none","dataSources":[{"sourceId":4284956,"sourceType":"datasetVersion","datasetId":2524646},{"sourceId":6792335,"sourceType":"datasetVersion","datasetId":3907556},{"sourceId":6938900,"sourceType":"datasetVersion","datasetId":3984839}],"dockerImageVersionId":30303,"isInternetEnabled":true,"language":"r","sourceType":"notebook","isGpuEnabled":false}},"nbformat_minor":4,"nbformat":4,"cells":[{"source":"<a href=\"https://www.kaggle.com/code/ginadsouza/google-capstone-project-cyclistic?scriptVersionId=155186816\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","source":"# **Google Capstone Project - Cyclistic, a bike-share company**\nWelcome to my Capstone project. In this Project, I will be analysing the customer data of a fictional bike-share company called 'Cyclistic'. The aim of this project is to get some insights on how annual members and casual riders differ from each other. These insights will be used to understand which marketing strategy will be most effective in converting casual riders into annual members.\nFrom the next paragraph, I will be writing a report as a junior data analyst working for 'Cyclistic'.","metadata":{}},{"cell_type":"markdown","source":"# **Preliminary Report**\n## **- Understanding the business task**\nThis analysis has three key objectives.\n1. Understand how annual members and casual riders differ\n2. Examine factors that can compel casual riders towards annual memberships.\n3. Devise strategies leveraging digital media to convert casual riders into committed members.\n\nMy focus will be dedicated to the first goal, i.e., understanding the nuances that set annual members and casual riders apart.\n## **- All about the data**\nIn this section, we delve into the heart of our analysis: the Data.\n\n**Source:**\nIt is sourced from 'Motivate International Inc.' under the terms of their [license](https://divvybikes.com/data-license-agreement), the dataset has been acquired from 'Amazon AWS'.\n\n**Data quality check:** \nThe dataset, available in CSV format and organized by month, stands out in terms of Reliability, Originality, Comprehensiveness, Currency, and Cited. Direct sourcing by the company ensures its trustworthiness.\n\n**Potential Bias and Privacy concern:**\nThe lack of unique customer identification in the dataset might hinder our analysis hence representing a form of bias that limits our exploration of individual customer behaviors and preferences. However, this limitation does offer the benefit of mitigating concerns about customer privacy, as personal data is not collected/provided.\n\n**Data Integrity:**\nThe dataset maintains integrity due to consistent columns with appropriate data types.\n\n**Data Sufficiency:**\nThe available data is adequate to provide a preliminary understanding of the distinctions between annual members and casual riders.","metadata":{}},{"cell_type":"markdown","source":"# **Data Cleaning**\n***NOTE: The following code is used to clean the data step by step. After the cleaning is complete, another report will be available summarising the cleaning process.***","metadata":{}},{"cell_type":"markdown","source":"### **Loading the required packages (will contain libraries required for purposes other than cleaning)**","metadata":{}},{"cell_type":"code","source":"library(tidyverse) #to help clean the data\nlibrary(janitor)\nlibrary(plyr)\nlibrary(dplyr)\nlibrary(lubridate)#to get date-datatype for data conversion of some columns\nlibrary(geosphere) #to calculate distance travelled\nlibrary(ggplot2) #for data viz\nlibrary(scales) # to change y-scale ticks","metadata":{"execution":{"i