ype":"stream"}]},{"cell_type":"markdown","source":"# **Data Cleaning Process Report**\n**Tool:** The data cleaning process utilizes the efficiency and capabilities of the R programming language. Given the dataset's size, employing R ensures a smooth and effective data cleaning process.\n\n**Data integrity:** To ensure data integrity, the following steps were taken:\n1. Data Source Validation:\nThe data source was rigorously validated for authenticity and relevance to the business question.\n2. Consistency Checks:\nChecks were performed to ensure data consistency and adherence to established standards.\n\n**Data Cleaning and Validation:**\n1. Handling Missing Values:\nMissing values were identified in non-relevant columns and subsequently dropped, ensuring no impact on the analysis.\n2. Data Type Standardization:\nData types were appropriately standardized for consistency.\n3. Cross-Field Validation:\nValidation ensured recorded data accuracy and logical coherence.\n4. Outlier Detection:\nNo outliers were found, indicating data within expected ranges.\n5. Pre-Data Appending Validation:\nValidation checks were conducted before appending all tables to ensure the proper alignment, coherence, and consistency of the data, guaranteeing a seamless and accurate merging process.\n6. Documentation:\nEach step, documented in this R notebook, includes reasons and outcomes for transparency.\nThese measures collectively bolster data integrity, ensuring a reliable dataset for subsequent analysis.","metadata":{}},{"cell_type":"markdown","source":"# **Let's analyse our clean data.!**\nNow that we have cleaned our data, let us try to get some insights on how casual members are different from annual members.\nTo do so, we have to perform some descriptive analysis.\n\n**1) Find the max, min and other statistical parameters of ride_length and the mode of day_of_week to create a summary table**","metadata":{}},{"cell_type":"code","source":"#finding max, min, mean, median of ride_length\nsetNames(aggregate(ride_length_in_mins~member_casual,annual_data,each(mean,median,min,max)),c('member_casual','mean, median, min, max (in mins)'))\n\n#creating a mode function as R doesn't have a built in 'mode' function\nfind_mode <- function(x) {\n  u <- unique(x)\n  tab <- tabulate(match(x, u))\n  u[tab == max(tab)]\n}\n#using the defined mode function\n result <- annual_data %>%\n  group_by(member_casual) %>%\n  group_modify(~ summarise(., mode_day_of_week = find_mode(day_of_week)))\nprint(result)","metadata":{"execution":{"iopub.status.busy":"2023-12-15T21:35:36.439733Z","iopub.execute_input":"2023-12-15T21:35:36.441769Z","iopub.status.idle":"2023-12-15T21:35:48.052483Z"},"trusted":true},"execution_count":20,"outputs":[{"output_type":"display_data","data":{"text/html":"<table class=\"dataframe\">\n<caption>A data.frame: 2 × 2</caption>\n<thead>\n\t<tr><th scope=col>member_casual</th><th scope=col>mean, median, min, max (in mins)</th></tr>\n\t<tr><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;dbl[,4]&gt;</th></tr>\n</thead>\n<tbody>\n\t<tr><td>casual</td><td>29.21285, 14.400000, 0, 41629.17</td></tr>\n\t<tr><td>member</td><td>12.93272,  9.016667, 0,  1559.90</td></tr>\n</tbody>\n</table>\n","text/markdown":"\nA data.frame: 2 × 2\n\n| member_casual &lt;chr&gt; | mean, median, min, max (in mins) &lt;dbl[,4]&gt; |\n|---|---|\n| casual | 29.21285, 14.400000, 0, 41629.17 |\n| member | 12.93272,  9.016667, 0,  1559.90 |\n\n","text/latex":"A data.frame: 2 × 2\n\\begin{tabular}{ll}\n member\\_casual & mean, median, min, max (in mins)\\\\\n <chr> & <dbl{[},4{]}>\\\\\n\\hline\n\t casual & 29.21285, 14.400000, 0, 41629.17\\\\\n\t member & 12.93272,  9.016667, 0,  1559.90\\\\\n\\end{tabular}\n","text/plain":"  member_casual mean, median, min, max (in mins)\n1 casual        29.21285, 14.400000, 0, 41629.17\n2 member        12.93272,  9.016667, 0,  1559.90"},"metadata":{}},{"name":"stdout","text":"\u001b[90m# A tibble: 2 × 2\u001b[39m\n\u001b[90m# Groups:   member_casual [2]\