e dataframe so that we can confirm if our next code block gives right answer\ntable(annual_data$day_of_week)","metadata":{"execution":{"iopub.status.busy":"2023-12-15T21:50:21.454405Z","iopub.execute_input":"2023-12-15T21:50:21.456692Z","iopub.status.idle":"2023-12-15T21:50:21.633485Z"},"trusted":true},"execution_count":33,"outputs":[{"output_type":"display_data","data":{"text/plain":"\n   Monday   Tuesday Wednesday  Thursday    Friday  Saturday    Sunday \n   772040    797187    804400    838776    814313    981054    893544 "},"metadata":{}}]},{"cell_type":"code","source":"#length = number of times a particular day_of_week appeared in the df.\n# eg: how many times 'sunday' appeared in the dataframe\nday_of_week_length_1_year_data <- setNames(aggregate(ride_length_in_mins~member_casual+day_of_week,annual_data,length),c('member_casual','day_of_week','number_of_rides'))\n#day_of_week_length_1_year_data\n# head(day_of_week_length_data)\n\n#resizing the plot\noptions(repr.plot.width = 20, repr.plot.height =10) \n\n#plotting the graph\nplot_4 <- ggplot(data=day_of_week_length_1_year_data,aes(x=day_of_week,y=number_of_rides,fill=member_casual))+\ngeom_col()+\nscale_fill_manual(values=c(\"skyblue\",\"#116b1c\"))+\nfacet_wrap(~ member_casual)+\ntheme(\n    axis.text = element_text(size = 12),          # Size of axis labels\n    axis.title = element_text(size = 14),         # Size of axis titles\n    strip.text = element_text(size = 14),         # Size of facet headings\n    plot.caption = element_text(size = 15, hjust = 0.5, margin = margin(t = 10))  # Size, position, and margin of the caption\n  ) +\nlabs(caption = \"NOTE: The x-axis has been shifted up the y-axis so the reading of the bars does not start at 0\") +\n#theme(axis.text = element_text(size = 12))+\nscale_y_continuous(labels = scales::number_format(scale = 1e-4, suffix = \"tk\"),expand=c(0,0))+\ncoord_cartesian(ylim = c(200000,550000))+\ngeom_text(aes(label = number_of_rides), vjust = -0.5, size = 5) \n\nprint