average_ride_duration <- round(day_of_week_mean_1_year_data$average_ride_duration, 2)\n\n#resizing the plot\noptions(repr.plot.width = 20, repr.plot.height =10) \n\n#plotting the graph\nplot_5 <- ggplot(data=day_of_week_mean_1_year_data,aes(x=day_of_week,y=average_ride_duration,fill=member_casual))+\ngeom_col()+\nscale_fill_manual(values=c(\"skyblue\",\"#116b1c\"))+\nfacet_wrap(~ member_casual)+\ntheme(\n    axis.text = element_text(size = 12),          # Size of axis labels\n    axis.title = element_text(size = 14),         # Size of axis titles\n    strip.text = element_text(size = 14)         # Size of facet headings\n    ) +\ntheme(axis.text = element_text(size = 12))+\ngeom_text(aes(label = average_ride_duration), vjust = -0.5, size = 5) \n\nprint(plot_5)\n\n#finding max and min length in day_of_week_data\nday_of_week_mean_1_year_data[order(-day_of_week_mean_1_year_data$average_ride_duration),]","metadata":{"execution":{"iopub.status.busy":"2023-12-15T21:50:48.819652Z","iopub.execute_input":"2023-12-15T21:50:48.821967Z","iopub.status.idle":"2023-12-15T21:50:54.749094Z"},"trusted":true},"execution_count":35,"outputs":[{"output_type":"display_data","data":{"text/html":"<table class=\"dataframe\">\n<caption>A data.frame: 14 × 3</caption>\n<thead>\n\t<tr><th></th><th scope=col>member_casual</th><th scope=col>day_of_week</th><th scope=col>average_ride_duration</th></tr>\n\t<tr><th></th><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;fct&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n</thead>\n<tbody>\n\t<tr><th scope=row>13</th><td>casual</td><td>Sunday   </td><td>33.97</td></tr>\n\t<tr><th scope=row>11</th><td>casual</td><td>Saturday </td><td>31.83</td></tr>\n\t<tr><th scope=row>1</th><td>casual</td><td>Monday   </td><td>29.72</td></tr>\n\t<tr><th scope=row>9</th><td>casual</td><td>Friday   </td><td>27.41</td></tr>\n\t<tr><th scope=row>7</th><td>casual</td><td>Thursday </td><td>26.20</td></tr>\n\t<tr><th scope=row>3</th><td>casual</td><td>Tuesday  </td><td>25.45</td>