 duration is **highest** on **Sunday** (33.97 mins)\n* **lowest** on **Wednesday** (25 mins)\n\nFor **annual members** on **average**,\n* Ride duration is **highest** on **Sunday** (14.63 mins)\n* **lowest** on **Tuesday** (12.15 mins)\n\nAnother interesting thing to note is that **casual users** use the service for a significantly **longer time** than **annual members**.","metadata":{}},{"cell_type":"markdown","source":"**6)Exploring seasonal trends: An analysis of riding behaviors**\n\nWhile exploring the data, I observed that the months are not in chronological order. I have arranged them sequentially.\n\nPlease note that the data spans from August 2021 to July 2022, so the months start from August, not January.","metadata":{}},{"cell_type":"code","source":"annual_data$month <- factor(annual_data$month, levels = c(\"August\",\"September\",\"October\",\"November\",\"December\",\"January\",\"February\",\"March\",\"April\",\"May\",\"June\",\"July\"))","metadata":{"execution":{"iopub.status.busy":"2023-12-15T21:51:08.611709Z","iopub.execute_input":"2023-12-15T21:51:08.613584Z","iopub.status.idle":"2023-12-15T21:51:10.375388Z"},"trusted":true},"execution_count":36,"outputs":[]},{"cell_type":"markdown","source":"**- 6.1 Number of rides** \n\nIn this section, we delve into the overall patterns of ride frequency, examining how the number of rides varies across months.\n\nNote: Initally I thought the code chunk below would give a good and deeper insight over the behavior of customers, but it ended up being unhelpful as I couldnt understand how to make sense of the graphs. I have chosen to keep this code chunk as the process of writing it helped me to understand how to use ggplot better. You can ignore the code chunks as it won't be used for analysis.","metadata":{}},{"cell_type":"code","source":"# IGNORE THIS CODE CHUNK\nnumber_of_rides_seasonal_data <- setNames(aggregate(ride_length_in_mins~member_casual+month+day_of_week,annual_data,length),c('member_casual','month','day_of_week','number_of_rides'))\n\n#resizing the plot\noptions(repr.plot.width = 25, repr.plot.height =30) \n\n#plotting the graph\nplot_6_1_v1 <- ggplot(data=number_of_rides_seasonal_data,aes(x=day_of_week,y=number_of_rides,fill=member_casual))+\ngeom_col()+\nscale_fill_manual(values=c(\"skyblue\",\"#116b1c\"))+\nfacet_wrap(month~ member_casual, ncol = 4) +  # Facet by month using facet_wrap\ntheme(\n    axis.text = element_text(size = 12),          # Size of axis labels\n    axis.title = element_text(size = 14),         # Size of axis titles\n    strip.text = element_text(size = 14)         # Size of facet headings\n    ) +\ntheme(axis.text = element_text(size = 12))+\ngeom_text(aes(label = number_of_rides), vjust = -0.5, size = 5) \n\nprint(plot_6_1_v1)\n\n#finding max and min length in day_of_week_data\n#number_of_rides_seasonal_data[order(-number_of_rides_seasonal_data$number_of_rides),]","metadata":{"execution":{"iopub.status.busy":"2023-12-15T21:51:14.213085Z","iopub.execute_input":"2023-12-15T21:51:14.215022Z","iopub.status.idle":"2023-12-15T21:51:23.185467Z"},"trusted":true},"execution_count":37,"outputs":[{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAC7gAAA4QCAIAAABZAN4KAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdZ2BTZRfA8XOTNk2bUuigZW8QRGQJiCjLBSKIDAUZgqBsZIqCsgQHCLwgiCB7\nyEZlyFaG4GDJ3iIU6E5butvc5P0QrCVtoamlacj/94nenNznJF5znufm5F7FYrEIAAAAAAAA\nAAAAAAAA8LDTODoBAAAAAAAAAAAAAAAAID/QKAMAAAAAAAAAAAAAAACXQKMMAAAAAAAAAAAA\nAAAAXAKNMgAAAAAAAAAAAAAAAHAJNMoAAAAAAAAAAAAAAADAJdAoAwAAAAAAAAAAAAAAAJdA\nowwAAAAAAAAAAAAAAABcAo0yAAAAAAAAAAAAAAAAcAlujk7AWamqev36dUdnAQAAHojy5ctn\nuT06OjomJiafkwEAAPkgu+ovIn///bfFYsnPZAAAQP7IbgJw+/btqKiofE4GAADkj3ucAYDr\noFEm99LS0hydAgAAyFeqqjIBAADA1aSlpdEoAwCASzGbzSz/AQAAHmLcegkAAAAAAAAAAAAA\nAAAugUYZAAAAAAAAAAAAAAAAuAQaZQAAAAAAAAAAAAAAAOASaJQBAAAAAAAAAAAAAACAS6BR\nBgAAAAAAAAAAAAAAAC6BRhkAAAAAAAAAAAAAAAC4BBplAAAAAAAAAAAAAAAA4BJolAEAAAAA\nAAAAAAAAAIBLoFEGAAAAAAAAAAAAAAAALsHN0QkAQJ45/knXYbtuikjQk5NXf/qUo9MBAAAP\nHNU