.","metadata":{}},{"cell_type":"code","source":"number_of_rides_year_data <- setNames(aggregate(ride_length_in_mins~member_casual+month,annual_data,length),c('member_casual','month','number_of_rides'))\n\n# Create a vector of month names for better vizualisation\nmonth_names <- c(\"August\", \"September\", \"October\", \"November\", \"December\", \"January\", \"February\", \"March\", \"April\", \"May\", \"June\", \"July\")\n\n#resizing the plot\noptions(repr.plot.width = 20, repr.plot.height =5) \n\n#plotting the graph\nplot_6_1 <- ggplot(data=number_of_rides_year_data,aes(x=as.numeric(month),y=number_of_rides,color=member_casual))+\ngeom_line()+\ngeom_point()+\nscale_fill_manual(values=c(\"skyblue\",\"#116b1c\"))+\ntheme(\n    axis.text = element_text(size = 12),          # Size of axis labels\n    axis.title = element_text(size = 14),         # Size of axis titles\n    strip.text = element_text(size = 14)         # Size of facet headings\n    ) +\ntheme(axis.text = element_text(size = 12))+\ntheme(axis.title.x = element_blank()) +  # x-axis labels\ngeom_text(aes(label = number_of_rides), vjust = -0.5, size = 5)+\nscale_y_continuous(labels = scales::number_format(scale = 1e-6, suffix = \"m\"))+ # Gives label to the points\nscale_x_continuous(breaks = 1:12, labels = month_names)\n\nprint(plot_6_1)\n\n#finding max and min length in day_of_week_data\n#number_of_rides_year_data[order(-anumber_of_rides_year_data$number_of_rides),]","metadata":{"execution":{"iopub.status.busy":"2023-12-15T21:51:27.726353Z","iopub.execute_input":"2023-12-15T21:51:27.728388Z","iopub.status.idle":"2023-12-15T21:51:33.393223Z"},"trusted":true},"execution_count":38,"outputs":[{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAACWAAAAJYCAIAAABpAUoDAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdeZxcVZk38Ofcrfaq3vfu6i3dSQgEEkKChCUIEkTCCAgMg6KCuOELjoCgozLq\n6CiC4syoI8sA7pHIvoTNgEAgCUmAhKSz9L5Vb1Vde93tvH9Ud6e7eqsOSao7/ft+8kdy71Pn\nnDpVde/Nfe45h3HOCQAAAAAAAAAAAAAAAADmByHTDQAAAAAAA