 2022** (85250 rides)\n\nIt seems like the **number of rides** are **affected** by the **seasonal changes** happening in Chicago.","metadata":{}},{"cell_type":"markdown","source":"**-6.2) Average ride times**\n\nIn this section, we explore the average duration of rides for both casual and annual members. Key points covered include:\n\n  -  Monthly Variations: Examining how the average ride duration changes from month to month.\n  -  Member Category Differences: Contrasting the average ride times between casual and annual members.\n\n**Note:** Please ignore the below code chunk too. I thought it would tell me something interesting but I couldn't really make sense of it. But it was fun to tweak around.","metadata":{}},{"cell_type":"code","source":"# IGNORE THIS CODE CHUNK\naverage_ride_time_seasonal_data <- setNames(aggregate(ride_length_in_mins~member_casual+month+day_of_week,annual_data,mean),c('member_casual','month','day_of_week','average_ride_time'))\n\n# Round the mean values to 2 decimal places\naverage_ride_time_seasonal_data$average_ride_time <- round(average_ride_time_seasonal_data$average_ride_time, 2)\n\n#resizing the plot\noptions(repr.plot.width = 25, repr.plot.height =30) \n\n#plotting the graph\nplot_6_2_v1 <- ggplot(data=average_ride_time_seasonal_data,aes(x=day_of_week,y=average_ride_time,fill=member_casual))+\ngeom_col()+\nscale_fill_manual(values=c(\"skyblue\",\"#116b1c\"))+\nfacet_wrap(month~ member_casual, ncol = 4) +  # Facet by month using facet_wrap\ntheme(\n    axis.text = element_text(size = 12),          # Size of axis labels\n    axis.title = element_text(size = 14),         # Size of axis titles\n    strip.text = element_text(size = 14)         # Size of facet headings\n    ) +\ntheme(axis.text = element_text(size = 12))+\ngeom_text(aes(label = average_ride_time), vjust = -0.5, size = 5) \n\nprint(plot_6_2_v1)\n\n#finding max and min length in day_of_week_data\n#average_ride_time_seasonal_data[order(-average_ride_time_seasonal_data$number_of_rides),]","metadata":{"execution":{"iopub.status.busy":"2023-12-15T21:51:44.29146Z","iopub.execute_input":"2023-12-15T21:51:44.29337Z","iopub.status.idle":"2023-12-15T21:51:53.27861Z"},"trusted":true},"execution_count":39,"outputs":[{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAC7gAAA4QCAIAAABZAN4KAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd2BTVfvA8ecmaZruAbTsIUMQEUEBUUHBBa+CKKAsEUUFBEQEREEQUVwI/GSI\noCyFFxRwAMpUQQUHQ6ZsGQXaQkl306a5ub8/4ltKSktT2ozm+/mrPffknude6MlzT57cq2ia\nJgAAAAAAAAAAAAAAAEB5p/N0AAAAAAAAAAAAAAAAAIA7UCgDAAAAAAAAAAAAAAAAv0ChDAAA\nAAAAAAAAAAAAAPwChTIAAAAAAAAAAAAAAADwCxTKAAAAAAAAAAAAAAAAwC9QKAMAAAAAAAAA\nAAAAAAC/QKEMAAAAAAAAAAAAAAAA/AKFMgAAAAAAAAAAAAAAAPALBk8HUMpUVT19+rSnowAA\nAO5Wp06dK7afO3cuJyfHzcEAAADPKiwxSE1NNZvNbg4GAAB4VmGJgdVqPXv2rJuDAQAAHldY\nbgC/Ut4KZUQkNzfX0yEAAABvYbPZyA0AAICDqqokBgAAIA+JAQAAgH/i0UsAAAAAAAAAAAAA\nAADwCxTKAAAAAAAAAAAAAAAAwC9QKAMAAAAAAAAAAAAAAAC/QKEMAAAAAAAAAAAAAAAA/AKF\nMgAAAAAAAAAAAAAAAPALFMoAAAAAAAAAAAAAAADAL1AoAwAAAAAAAAAAAAAAAL9AoQwAAAAA\nAAAAAAAAAAD8AoUyAAAAAAAAAAAAAAAA8AsGTwcAwL/89XaflzaeFZHY2yYte+d2T4cDAAA8\nicQAAIDywr5vy5o1G38+cOifi2lpqs4YXalKwya33Nep+x2NKnk6tlK2qk+naWcz+ixb0z82\nxNOxAADgnUgMAADejkIZAG6k2T76NdHxY9Jfs7LU1sF6xbMRuWT1t9+qmtalSxdPBwIAQLlA\nYgAAQLlgV80zXx7y9a54EdHpgypUjNFyM8+fPZF45p+f133V8vHR7w64r+xG5x0ZAACvQmIA\nAPAJFMoAcJ+MuPnHLDa9PiJY0tNzzs09kfZivQhPB+WCWdM/zLGTZAMAUDpIDAAAKB82vTnk\n613xhuA6z4wc9lDbm0L0iohY085tXr1s2oLv/lj29vhqDSc+VKOMRucdGQAAr0JiAADwCTpP\nBwDAj+yf85OIRDQc9Ox14SKy7eM9no4IAAB4DIkBAADlgGo58v7PCSIycNb0x9s1Dfnf/eGM\n4VXv7/3SRy/dJiLbZr2eY/dkkAAAwD1IDAAAvoJCGQBuoqmWmTsviMitA1u06n+DiJj3zsxQ\nNU/HBQAAPIDEAACA8sFiXqNqmt5Up2vt0IJbaz3wcqBeUbNP7My0lnwMTc1V1ZK/vBiyLDle\nlYVkns/2dAgAAJRE+UgMxMtyAxIDACgLPHoJgJuk/jPnbI6qN0QPahQZZhsQoPstN/fC7KMp\noxpG5e92evWQJ6ceqNtrzqfPNsjffmzRgGcXHrn+uXkf97wurzFx99q5i7/edehUthJ63Y0t\nHu//fOOMSd2G/9n4pUUzO9V0aW+2zFNfLvrvlt//iks023SmyjXr3dH+4Se7323SKSLy61Nd\nxp1MdfRs166diKzc9EO0nlpDAABKyMsTAykyNyAxAAAgj2a3iIiWG2+22aMNzu+GOn3EG+Ne\nz7Lbawfq8x