alysis is below:","metadata":{}},{"cell_type":"code","source":"average_ride_time_year_data <- setNames(aggregate(ride_length_in_mins~member_casual+month,annual_data,mean),c('member_casual','month','average_ride_time'))\n\n# Round the mean values to 2 decimal places\naverage_ride_time_year_data$average_ride_time <- round(average_ride_time_year_data$average_ride_time, 2)\n\n# Create a vector of month names for better vizualisation\nmonth_names <- c(\"August\", \"September\", \"October\", \"November\", \"December\", \"January\", \"February\", \"March\", \"April\", \"May\", \"June\", \"July\")\n\n#resizing the plot\noptions(repr.plot.width = 20, repr.plot.height =5) \n\n#plotting the graph\nplot_6_2 <- ggplot(data=average_ride_time_year_data,aes(x=as.numeric(month),y=average_ride_time,color=member_casual))+\ngeom_line()+\ngeom_point()+\nscale_fill_manual(values=c(\"skyblue\",\"#116b1c\"))+\n#facet_wrap(month~ member_casual, ncol = 4) +  # Facet by month using facet_wrap\ntheme(\n    axis.text = element_text(size = 12),          # Size of axis labels\n    axis.title = element_text(size = 14),         # Size of axis titles\n    strip.text = element_text(size = 14)         # Size of facet headings\n    ) +\ntheme(axis.text = element_text(size = 12))+\ntheme(axis.title.x = element_blank()) +  # x-axis labels\ngeom_text(aes(label = average_ride_time), vjust = -0.5, size = 5)+  # Gives label to the points\nscale_x_continuous(breaks = 1:12, labels = month_names)\n\nprint(plot_6_2)\n\n#finding max and min length in day_of_week_data\n#average_ride_time_year_data[order(-average_ride_time_year_data$number_of_rides),]","metadata":{"execution":{"iopub.status.busy":"2023-12-15T21:52:00.926368Z","iopub.execute_input":"2023-12-15T21:52:00.928209Z","iopub.status.idle":"2023-12-15T21:52:08.254877Z"},"trusted":true},"execution_count":40,"outputs":[{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAACWAAAAJYCAIAAABpAUoDAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdeXAcR3