C3J3csAToZAAAFRPqP8BQAvUFQBFIEBY9QU2H/DdR6GLVv7592+r0o1yYFhkj74j+j/Tu8SZ\nAAAAAAAAPNO4gX3Pm2xEdM+QMf4c2rJQAhQSAIDqCfU/AGiBugKgCMxBCAAAAAAAlcDvC2fF\nZciN2t3/WOfG7k4LeCgUEgCA6gn1PwBogboCoAgECAEAAAAAAAAAAAAAAACqEdbdCQAAAAAA\nAAAAAAAAAACAOwcBQgAAAAAAAAAAAAAAAIBqBAFCAAAAAAAAAAAAAAAAgGoEAUIAAAAAAAAA\nAAAAAACAagQBQgAAAAAAAAAAAAAAAIBqBAFCAAAAAAAAAAAAAAAAgGoEAUIAAAAAAAAAAAAA\nAACAagQBQgAAAAAAAAAAAAAAAIBq5P+5OxXeh8kkDQAAAABJRU5ErkJggg=="},"metadata":{"image/png":{"width":1200,"height":300}}}]},{"cell_type":"markdown","source":"From the above plot it is seen that:\n- Upon initial observation, it may appear that the trends in average ride time vary between casual and annual members. However, upon closer examination, it becomes evident that both groups exhibit similar patterns, albeit with differing magnitudes of change.\n- **Casual members**:\n  - **experience fluctuations in average ride times**, ranging from a peak of 32.62 minutes in March 2022 to a low of 23.13 minutes in November 2021.\n  - The months can be divided into 5 groups:\n    - 1) August, September, October (values differ by ~1 minute)\n    - 2) November and December (values differ by a few seconds)\n    - 3) January (exhibits a sudden increase to ~30 minutes)\n    - 4) February (decreases to ~26 mins)\n    - 5) March, April, May, June, July (values differ by ~3 mins)\n- The average ride time of **annual members** remains **relatively stable**, with its maximum being 14.1 mins (August) and the minimum being 11 mins (December).\n\nIn summary, **casual members exhibit erratic riding patterns, while annual members demonstrate more consistent habits.**","metadata":{}},{"cell_type":"markdown","source":"**-6.3) Bike Preference Analysis**\n\nThis section delves into the bike rental preferences of casual users and annual members. It explores variations in bike types rented, providing insights into how these preferences evolve across different months.\n\nInitially, we'll examine the overall bike preferences of both casual and annual members","metadata":{}},{"cell_type":"code","source":"member_type_vs_rideable_type<- setNames(aggregate(ride_length_in_mins~member_casual+rideable_type,annual_data,length),c(\"member_casual\",\"rideable_type\",\"count\"))\n#member_type_vs_rideable_type\n\n#creating levels so that the plot is easier to read\nmember_type_vs_rideable_type$rideable_type <- factor(member_type_vs_rideable_type$rideable_type, levels = c(\"classic_bike\",\"electric_bike\",\"docked_bike\"))\n\n# Resizing the plot\noptions(repr.plot.width = 10, repr.plot.height =8) \n\n# Plotting the graph\nplot_6_3_1 <- ggplot(data=member_type_vs_rideable_type,aes(x=rideable_type,y=count,fill=member_casual))+\ngeom_col()+\nscale_fill_manual(values=c(\"skyblue\",\"#116b1c\"))+\nfacet_wrap(~ member_casual)+\ntheme(\n    axis.text = element_text(size = 12),          # Size of axis labels\n    axis.title = element_text(size = 14),         # Size of axis titles\n    strip.text = element_text(size = 14)         # Size of facet headings\n    ) +\ntheme(axis.text = element_text(size = 12))+\ngeom_text(aes(label = count), vjust = -0.5, size = 5)\n\nprint(plot_6_3_1)","metadata":{"execution":{"iopub.status.busy":"2023-12-15T21:52:17.76388Z","iopub.execute_input":"2023-12-15T21:52:17.765727Z","iopub.status.idle":"2023-12-15T21:52:25.386975Z"},"trusted":true},"execution_count":41,"outputs":[{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAABLAAAAPACAIAAACqxhfXAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdeYDM9R/H8fd3ZnZm75N1rCO5UskZSTkrR4hUSFQoKpJKREmJDkVKbjnLHflR\nzlzlyBVCu27rWmvve87fH8O21u4a0s6sz/Px18533vN5f3a+fHde8700h8MhAAAAAAD16Nw9\nAQAAAACAexAIAQAAAEBRBEIAAAAAUBSBEAAAAAAURSAEAAAAAEURCAEAAABAUQRCAAAAAFAU\ngRAAAAAAFGVw9wRUd/78+czMTHfPAgCKjAoVKuS5PD09PSYmppAnAwBFWn5bVCiFQOhmNpvN\nYrG4exYAUOTZ7XY2pwAA3CgOGQUAAAAARREIAQAAAEBRBEIAAAAAUBSBEAAAAAAURSAEAAAA\nAEURCAEAAABAUQRCAAAAAFAUgRAAAAAAFEUgBAAAAABFEQgBFLaLOwc2bdq086Dd7p4IALjf\n8ufaNm3adHpMmrsnAkBRBEIAAAAAUBSBEAAAAAAURSAEAAAAAEURCAEAgELS