lUF9SxBtD4SgYG43rqKEUEVAayRFYXo3XAUl42SKLjzefv5Tuvt37fRI\n9po1yuUt8bkOdev+eGz9l6eMaVzsQUI1w3rcnWRpM3vaELUDAQAAAACUBtxmokh4c3fd0/O5\n8CqPfPluZ7VjQREqvKMSOCvYEkIVAa1hEgZcHSkitpBHdJe/+cr8NOmdWTPynufat/AzIUS9\nB6oWa3QAAAAAAADA+Y4tmawoSoO+zS6/KUqSwjsqgbOCLSFUEdAaEoQoSt2Gdf7xhW//N2TE\nHW1virHJx/duXPj79vBqdzxRh1H5AAAAAAAAUIfD5dM5DoyfsVc2JgyoG612OABCC1UEtIkE\nIYpSVL2HPn0tbursJSt/npPm8EfFV2jbfdCDPTsU+joBAAAAAAAAoBi80Kv7PqdXCHFz3+ER\nMh1VAM5DFQFt4h2EAAAAAAAAAEqzhV98tDXdX/Om27u0qKV2LABCDlUEtIkEIQAAAAAAAAAA\nAKAhOrUDAAAAAAAAAAAAAFB8SBACAAAAAAAAAAAAGkKCEAAAAAAAAAAAANAQEoQAAAAAAAAA\nAACAhpAgBAAAAAAAAAAAADSEBCEAAAAAAAAAAACgISQIAQAAAAAAAAAAAA0hQQgAAAAAAAAA\nAABoyP8B9vZOTyEwKiMAAAAASUVORK5CYII="},"metadata":{"image/png":{"width":1200,"height":600}}}]},{"cell_type":"markdown","source":"It seems like there is significant changes in the preference but the changes is most likely due to the change in the number of people riding the bike as the season changes. To get a more accurate picture, it is better to see the above graph by taking into consideration the change in number of rides.\n\nThis is done by normalising the monthly number of rides for each bike on a monthly basis. Hence, the values for each bike type would represent their contribution or share in the total rides for that month.","metadata":{}},{"cell_type":"code","source":"rideable_type_vs_month <- setNames(aggregate(ride_length_in_mins~member_casual+month+rideable_type,annual_data,length),c(\"member_casual\",\"month\",\"rideable_type\",\"count\"))\n#rideable_type_vs_month\n\n#creating the required normalization constant\nNC <- setNames(aggregate(ride_length_in_mins~member_casual+month,annual_data,length),c(\"member_casual\",\"month\",\"constant\"))\n#NC\n\n#merging the above 2 dataframes\nNC_rideable_type_vs_month <- merge(rideable_type_vs_month,NC, by =c(\"month\", \"member_casual\"))\n#NC_rideable_type_vs_month\n\n#creating a new column to have the normalized values\nNC_rideable_type_vs_month <- NC_rideable_type_vs_month %>%\nmutate(Normalized_count = (count / constant)*100)\n#NC_rideable_type_vs_month\n\n#creating levels so that the plot is easier to read\nNC_rideable_type_vs_month$rideable_type <- factor(NC_rideable_type_vs_month$rideable_type, levels = c(\"classic_bike\",\"electric_bike\",\"docked_bike\"))\n\n# Create a vector of month names for better vizualisation\nmonth_names <- c(\"Aug\", \"Sept\", \"Oct\", \"Nov\", \"Dec\", \"Jan\", \"Feb\", \"March\", \"April\", \"May\", \"June\", \"July\")\n\n# Resizing the plot\noptions(repr.plot.width = 20, repr.plot.height =10) \n\n# Plotting the graph\nplot_6_3_3 <- ggplot(data=NC_rideable_type_vs_month,aes(x=as.numeric(month),y=Normalized_count,color=rideable_type))+\ngeom_line()+\ngeom_point()+\nscale_color_manual(values=c(\"#000000\",\"#4CBB17\",\"#B660CD\"))+\nfacet_wrap(~member_casual, ncol=1)+\ntheme(\n    axis.text = element_text(size = 12),          # Size of axis labels\n    axis.title = element_text(size = 14),         # Size of axis titles\n    strip.text = element_text(size = 14)         # Size of facet headings\n    ) +\ntheme(axis.text = element_text(size = 12))+\ntheme(axis.title.x = element_blank()) + \nylab(\"normalized_count * 100\")+\ngeom_text(aes(label = sprintf(\"%.2f\", Normalized_count)), vjust = -0.5, size = 5)+\nscale_x_continuous(breaks = 1:12, labels = month_names)\n\nprint(plot_6_3_3)","metadata":{"execution":{"iopub.status.busy":"2023-12-15T21:52:43.761583Z","iopub.execute_input":"2023-12-15T21:52:43.763475Z","iopub.status.idle":"2023-12-15T21:52:57.519453Z"},"trusted":true},"execution_count":43,"outputs":[{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAACWAAAASwCAIAAADwxubWAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd3wVVf7/8c/M3Jab23KTQAKhSFOK0sSyqBQBddUVXXUVFfvu2lDXturqT/2K\nYtu1rL3j2it2igI2FBDpTSI9pOe23Nw2M78/LsQQWihykft6Pvgjd+bMPZ+Zxwz3Zt45cxTT\nNAUAAAAAAAAAAABAdlAzXQAAAAAAAAAAAACAvYeAEAAAAAAAAAAAAMgiBIQAAAAAAAAAAABA\nFiEgBAAAAAAAAAAAALIIASEAAAAAAAAAAACQRQgIAQAAAAAAAAAAgCxCQAgAA