ECzBYWCCEEixc\nRm1earNz/+mLJw5k5GotbB26e/uPHOZV5hsCAAAAAAAAAAAAdNACH+9HCjURfewbYMZiYgsA\n3grhAgwW3kEIAAAAAAAAAAAAeuXkjo0Rmdqm7j0HeDSr7roAgE5DuACDhQVCAAAAAAAAAAAA\nAAAAAAMiqO4KAAAAAAAAAAAAAAAAAEDVwQIhAAAAAAAAAAAAAAAAgAHBAiEAAAAAAAAAAAAA\nAACAAcECIQAAAAAAAAAAAAAAAIABwQIhAAAAAAAAAAAAAAAAgAHBAiEAAAAAAAAAAAAAAACA\nAcECIQAAAAAAAAAAAAAAAIABwQIhAAAAAAAAAAAAAAAAgAH5f2KRWoVLWVO6AAAAAElFTkSu\nQmCC"},"metadata":{"image/png":{"width":1200,"height":600}}}]},{"cell_type":"markdown","source":"From the plot, we can see that:\n- **Casual members**:\n  - The share of docked bikes being rented stays between 11% (August) and 5% (January).\n  - The share of classic bike decreases to a minimum of 28.4% (December) in the fall-winter months and increases slightly in the summer months having a maximum of 55.73% (August).\n  - The share of electric bike follows an inverse trend to the classic bike with its minimum being 33.35% in August and its maximum being 64.53% in December.\n  - The shares of electric and classic bike is nearly equal in the months of May and June.\n- **Annual members**:\n  - The share of classic bikes decreases in the fall-winter months to a minimum of 45.46% (December), with a peak of 69.71% in August.\n  - The share of electric bikes follows an opposite trend to classic bikes with a minimum of 30.29% in August and maximum of 54.54% in December.\n  \nIn summary, the analysis suggests that **both casual and annual members** have a preference for **electric bikes** during **winter months** and a preference for c**lassic bikes** in **warmer months**.","metadata":{}},{"cell_type":"markdown","source":"# **Membership Insights Report: Analyzing the Differences Between Casual and Annual Bike-Sharing Users**\n## - Organization of the data:\nThe data has been systematically organized by concatenating all monthly datasets into a single CSV-formatted file.\n\n## - Unexpected discoveries:\n- Contrary to expectations, although casual members enjoy longer rides, the frequency of bike rentals is higher among annual members.\n- Additionally, one might have anticipated that the majority of rides for both annual and casual members would occur on weekends. However, this is not the case for annual members.\n\n## - Insights:\n- **Casual members** tend to have **longer rides**, averaging 15 minutes more than annual members.\n- **Annual members** rent **more frequently** than casual members (approx 860000 rides more).\n- **Casual members** show a tendency to rent **more frequently on weekends.** \n- Highest rental activity for annual members is observed on Tuesdays, Wednesdays, and Thursdays, while weekends see comparatively fewer rides.\n- **Annual members'** ride times remain **consistent** throughout the week, suggesting a likely daily commute pattern. In contrast, **casual members** exhibit more **variability**, indicative of recreational usage.\n- The **number of rides vary with seasonal change.**\n- **Annual members** have a slight preference for **classic bikes**, while **casual members** use a mix of **classic and electric bikes.**\n- All members favor **electric bikes** in **fall-winter** and **classic bikes** in **warmer months.**\n\n## - Conclusion:\nThese insights help understand the behavioural difference between annual and casual members. This will help us come up with effective strategies to convert more casual members into annual members. ","metadata":{}},{"cell_type":"markdown","source":"# **My recommendations for Converting Casual Members to Annual Members**\n- **Creation of a new type of annual membership:** As casual members tend to ride more during the weekends, creation of a new type of membership focusing on being beneficial for this type of behavior. This new membership can have,\n  - Weekly/monthly/seasonal challenges\n  - Information on places that would be ideal for biking\n  - Slight discount on the time rented so that if u arent an annual member, it would be more expensive.\n  - Implement a slight discount on ride time for annual members, making it a more cost-effective option.\n  - Offer exclusive benefits like complimentary minutes deducted from their ride duration once they surpass a specified time of riding to incentivize casual riders to switch to an annual membership.\n- **Exclusive mobile app features for annual members:** Include a map of popular biking routes, safety tips, and real-time updates on bike availability.\n- **Flexible membership options:** Offer monthly trial plans so that riders can experience the benefits of the annual plan before commiting to an annual membership.\n- **Introduction of a fun community:** Hold annual members only events where members can come together to form a cyclistic community.","metadata":{}}]}